    public static String decrypt(String encrypted) {
        System.out.println(encrypted + " " + encrypted.toCharArray().length);
        final int BTL = 8;
        char[] enChar = encrypted.toCharArray();
        StringBuilder res = new StringBuilder();
        String p;
        for (int i = 0; i < enChar.length; i++) {
            p = Integer.toBinaryString((int) enChar[i]);
            int n = 2 * BTL - p.length();
            for (int j = 0; j < n; j++) {
                p = "0".concat(p);
            }
            res.append((char) Integer.parseInt(p.substring(BTL), 2));
        }
        return res.toString();
//        char[] r=encrypted.toCharArray();
//        for(int i=0; i<r.length; i++) r[i]&=255;
//        return String.valueOf(r);
    }

