    public static boolean fortune(int f0, double p, int c0, int n, double i) {
        System.out.println(f0 + " " + p + " " + c0 + " " + n + " " + i);
        for (int j = 0; j < n - 1; j++) {
            f0 = f0 + ((Double) (f0 * p / 100)).intValue();
            f0 -= c0;
            c0 = c0 + ((Double) (c0 * i / 100)).intValue();
            if (f0 <= 0) return false;
        }
        return true;

    }

