    public static String game(long n) {
        long nn = n * n;
        return nn % 2 == 0 ? String.format("[%d]", nn / 2) : String.format("[%d, 2]", nn);
    }

    public static long thirt(long n) {
        final int[] SEQ = {1, 10, 9, 12, 3, 4};
        final int SEQ_LEN = 6;
        long oldN = n;
        long newN;
        while (true) {
            StringBuilder stb = new StringBuilder(String.valueOf(oldN));
            String str = stb.reverse().toString();
            newN = 0;
            for (int i = 0; i < str.length(); i++) {
                newN += Integer.parseInt(String.valueOf(str.charAt(i))) * SEQ[i % SEQ_LEN];
            }
            if (newN == oldN) return newN;
            oldN = newN;
        }
    }

    public static long countOddPentaFib(long n) {
        if (n % 2 == 0 && n % 3 == 0) {
            n -= 3;
        } else if (n % 2 == 1) n--;
        if (n % 3 == 2) return ++n / 3;
        if (n % 3 == 1) return --n / 3;
        return n / 3;

    }

