    public static int computeDepth(int n) {
        int i = 1;
        Set<Character> intSet = new HashSet<>();
        while (true) {
            intSet.addAll(String.valueOf(n * i++).chars().mapToObj(e -> (char) e).collect(Collectors.toSet()));
            if (intSet.size() == 10) return --i;
        }
    }

    public static int epidemic(int tm, int n, int s0, int i0, double b, double a) {
        double dt =((double) tm)/n;
        Double s =(double) s0;
        Double r = 0.0;
        Double i = (double) i0;
        int maxI = 0;
        for (int j = 0; j < n; j++) {
            Double iOld = i;
            i = i + dt * (b * s * i - a * i);
            s = s - dt * b * s * iOld;
            r = r + dt * iOld * a;
            if (maxI< (int)Math.round(i)) maxI = (int) Math.round(i);
        }
        return maxI;
    }

    public static int tankVol(int h, int d, int vt) {
        Double r = ((double)d) / 2;
        Double ss = Math.PI * Math.pow(r, 2);
        Double alph = 2 * Math.acos(1 - h / r);
        Double s = 1.0 / 2.0 * Math.pow(r, 2) * (alph - Math.sin(alph));
        return (int) (s / ss * vt);
    }

    public static long digPow(int n, int p) {
        String s = String.valueOf(n);
        int sum = 0;
        for (int i = 0; i < s.length(); i++) {
            sum += Math.pow(Integer.valueOf(s.substring(i, i + 1)), p++);
        }
        return sum % n == 0 ? sum / n : -1;
    }

